import { useState } from 'react';
import SuccessModal from '../components/SuccessModal';

function BookAService() {
    const [showSuccess, setShowSuccess] = useState(false);

    const [formData, setFormData] = useState({
        FName: '',
        LName: '',
        Company: '',
        Email: '',
        PhoneNumber: '',
        Message: ''
    });

    const handleChange = (e) => {
        setFormData(prev => ({ ...prev, [e.target.name]: e.target.value }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        try {
            const response = await fetch('http://localhost:5000/InquiriesPost/submitInquiries', {
                method: 'POST',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify(formData)
            });

            if (response.ok) {
                const result = await response.json();
                // alert('Inquiry submitted successfully!');
                console.log(result);
                console.log(formData);
                setFormData({
                    FName: '',
                    LName: '',
                    Company: '',
                    Email: '',
                    PhoneNumber: '',
                    Message: ''
                });
                setShowSuccess(true);
            } else {
                alert('Failed to submit inquiry');
            }
        } catch (error) {
            console.error('Error:', error);
            alert('Error submitting inquiry');
        }
    };

    const services = ['PREVENTIVE MAINTENANCE SERVICES', 'REFRIGERATION AND AC UNIT REPAIR', 'BODY AND COLLISION REPAIR']

    return (
        <>
            <div className="max-w-3xl mx-auto flex h-auto">
                <form action="#" method="POST" className="h-full mx-auto mt-10 w-full" onSubmit={handleSubmit}>
                    <div className="grid grid-cols-1 gap-x-4 gap-y-6 sm:grid-cols-2 flex w-full">
                        <div>
                            <label className="block text-sm/6 font-semibold text-gray-900">*Name</label>
                            <div className="mt-2.5">
                                <input id="firstname" type="text" name="FName" placeholder='First Name' value={formData.FName} onChange={handleChange}
                                    className="block w-full rounded-md bg-white px-3.5 py-2 text-base text-gray-900 outline-1 -outline-offset-1 outline-gray-300 placeholder:text-gray-400 focus:outline-2 focus:-outline-offset-2 focus:outline-indigo-600" />
                            </div>
                        </div>

                        <div className="">
                            <label className="block text-sm/6 font-semibold text-gray-900">*Email</label>
                            <div className="mt-2.5">
                                <input id="email" type="email" name="Email" placeholder='Email' value={formData.Email} onChange={handleChange}
                                    className="block w-full rounded-md bg-white px-3.5 py-2 text-base text-gray-900 outline-1 -outline-offset-1 outline-gray-300 placeholder:text-gray-400 focus:outline-2 focus:-outline-offset-2 focus:outline-indigo-600" />
                            </div>
                        </div>
                        <div className=''>
                            <label className="block text-sm/6 font-semibold text-gray-900">*Company Name</label>
                            <div className="mt-2.5">
                                <input id="lastname" type="text" name="LName" placeholder='Last Name' value={formData.LName} onChange={handleChange}
                                    className="block w-full rounded-md bg-white px-3.5 py-2 text-base text-gray-900 outline-1 -outline-offset-1 outline-gray-300 placeholder:text-gray-400 focus:outline-2 focus:-outline-offset-2 focus:outline-indigo-600" />
                            </div>
                        </div>
                        <div className="">
                            <label className="block text-sm/6 font-semibold text-gray-900">*Phone</label>
                            <div className="mt-2.5">
                                <input id="company" type="text" name="Company" placeholder='Company Name' value={formData.Company} onChange={handleChange}
                                    className="block w-full rounded-md bg-white px-3.5 py-2 text-base text-gray-900 outline-1 -outline-offset-1 outline-gray-300 placeholder:text-gray-400 focus:outline-2 focus:-outline-offset-2 focus:outline-indigo-600" />
                            </div>
                        </div>
                        <div className="">
                            <label className="block text-sm/6 font-semibold text-gray-900">* Service</label>
                            <div className="mt-2.5 h-[38px]">
                                <select className="w-full h-full flex rounded-md bg-white outline-1 -outline-offset-1 outline-gray-300 has-[input:focus-within]:outline-2 has-[input:focus-within]:-outline-offset-2 has-[input:focus-within]:outline-indigo-600">
                                    {services.map((services) => (
                                        <option value={services}>{services}</option>
                                    ))}
                                </select>
                            </div>


                            <div className="mt-2.5">
                                <div className="flex rounded-md bg-white outline-1 -outline-offset-1 outline-gray-300 has-[input:focus-within]:outline-2 has-[input:focus-within]:-outline-offset-2 has-[input:focus-within]:outline-indigo-600">
                                    <input id="phone-number" type="text" name="PhoneNumber" placeholder="+63" value={formData.PhoneNumber} onChange={handleChange}
                                        className="block min-w-0 grow py-1.5 pr-3 pl-1 text-base text-gray-900 placeholder:text-gray-400 focus:outline-none sm:text-sm/6" />
                                </div>
                            </div>
                        </div>
                        <div className="sm:col-span-2 h-full">
                            <label className="block text-sm/6 font-semibold text-gray-900">Message</label>
                            <div className="mt-2.5">
                                <textarea id="message" name="Message" rows="4" placeholder='Remarks' value={formData.Message} onChange={handleChange}
                                    className="block w-full rounded-md bg-white px-3.5 py-2 text-base text-gray-900 outline-1 -outline-offset-1 outline-gray-300 placeholder:text-gray-400 focus:outline-2 focus:-outline-offset-2 focus:outline-indigo-600"></textarea>
                            </div>
                        </div>
                    </div>
                    <div className="my-5 flex w-full h-full items-center justify-center">
                        <button type="submit" className="block w-full rounded-md bg-indigo-600 px-3.5 py-2.5 text-center text-sm font-semibold text-white shadow-xs hover:bg-indigo-500 focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600">Let's talk</button>
                    </div>
                </form>
            </div>
        </>
    )
}


export default BookAService;
